import React, { Component } from 'react';
import Button from 'react-bootstrap/Button'

class HeaderNav extends Component {
    constructor(props){
        super(props);
    }

    render(){
        return (
            <div style={{color:'white', marginTop:"7vh", textAlign:"center", justifyContent:"center", alignItems:"center"}}>
                <Button variant="Link" style={{color:"white"}}>
                    <Link to="/home/">Home</Link>
                </Button>
                <Button variant="Link" style={{color:"white"}}>
                    <Link to="/home/">Works</Link>
                </Button>
                <Button variant="Link" style={{color:"white"}}>
                    <Link to="/home/">Resume</Link>
                </Button>
            </div>
        );
    }
};

export default HeaderNav;
